The two filters `classNameFilter` and `classFilter` are combined into the internal `org.junit.platform.commons.util.ClassFilter` class since version 1.1 of the JUnit Platform. This class is used by `ReflectionUtils` and `ModuleUtils`.

I'd implement the facading method in `ReflectionSupport ` like:

```
public static List<Class<?>> findAllClassesInModule(
				String moduleName,
				Predicate<Class<?>> classFilter,
				Predicate<String> classNameFilter) {
  return ModuleUtils.findAllClassesInModule(moduleName, ClassFilter.of(classNameFilter, classFilter));
}
```

Now, only non-internal types are part of the API and the signature is similar to the other two `findAllClassesIn...` methods.

